    return (
        <div className="w-40 bg-gray-100 rounded-lg px-3 pt-3 flex gap-3">
            <div className="flex justify-between">
            <span className="bg-sky-100 text-sky-800 text-xs font-medium px-2.5 py-0.5 rounded border border-sky-400">ATT</span>
            <div className="text-center text-base text-[#6d6a7f]">Neymar JR</div>
            </div>
            <img className="h-28 object-contain object-bottom" alt="playerPhoto" src={`https://media.api-sports.io/football/players/${props.playerIndex}.png`}></img>
        </div>
    )
}

